INSERT INTO `behaviors` VALUES ('54', 'Analytical', 'Shows skill at understanding the numbers, appling strategy, can see a few moves ahead, excels at the mental challenges (puzzles, memory, etc.)', '', '', '2016-09-24 15:39:12', 'Richard Hatch invents the alliance; Cirie blindsides Courtney with the 3-2-1'), ('55', 'Diplomatic', 'Shows ability to compromise, repair relationships, is polite and emotionally intelligent', '', '', '2016-09-24 15:39:12', 'Trish brings Jefra back into the fold after a blindside'), ('56', 'Empathic', 'Is caring of other players, worries about people\'s feelings, nurtures others, is senstive', '', '', '2016-09-24 15:39:12', 'Terry comforts Abi-Maria after fight with Peih-gee; Aubry comforts Tai with \"the heart and the head\" speech'), ('57', 'Perceptive', 'Shows ability to tell when people are lying to them, hiding something, strategizing against them, or working with each other', '', '', '2016-09-24 15:39:12', 'Parvati detects that Amanda is lying to her when she tells her to \"play your idol tonight\"'), ('58', 'Charming', 'Shows likeable qualities, other players talk about enjoying their company, makes friends easily', '', '', '2016-09-24 15:39:12', ''), ('59', 'Funny', 'Makes people laugh and has funny confessionals', '', '', '2016-09-24 15:39:12', ''), ('60', 'Flirtatious', 'Uses sexual attraction to influence other players (not always successfully)', '', '', '2016-09-24 15:39:12', 'Julie Berry tans her bare bottom with Sarge; Parvati gets naked in the hot tub with Yul and Ozzy; male example'), ('61', 'Leadership', 'Shows leadership within the tribe or an alliance, takes initiative and has ideas, is highly competitive, shows admirable and heroic qualities', '', '', '2016-09-24 15:39:12', ''), ('62', 'Hardworking', 'Shows high energy around camp and at challenges, contributes and works hard, never sits down', '', '', '2016-09-24 15:39:12', ''), ('63', 'Industrious', 'Shows ability to problem solve, to find idols, to eaves drop or build spy shacks', '', '', '2016-09-24 15:39:12', 'Tony builds spy shack, Bob Crowley makes a fake idol, Russell finds idols without clues'), ('64', 'Deceptive', 'Shows skill at successfully deceiving others, creates stories on the spot, can quickly deflects suspicion, is good a persuading players to follow their plan', '', '', '2016-09-24 15:39:12', 'Cirie explaining Courtney vote to Shane; convincing Erik to give up his idol'), ('65', 'Moral', 'Uses moral judgements to justify behaviour, boasts about loyalty or integrity, makes decisions based on faith or their following of a certain code of conduct (religious, regional, cultural, eg. God, Texas, military)', '', '', '2016-09-24 15:39:12', 'Coach religion stuff in South Pacific; Matt Elrod\'s thing; Colby\'s \"that\'s how we do it in Texas\"'), ('66', 'Abrasive', 'Rubs people the wrong way, gets under people\'s skin, is annoying, shows any behaviour other players interpret as hard to be around', '', '', '2016-09-24 15:39:12', 'Max puts warty foot in the water; Philip mansplains Survivor to Franny'), ('67', 'Athletic', 'Shows notable athleticism in challenges or around camp, such that others comment on it or it is highlighted in the edit', '', '', '2016-09-24 15:39:12', ''), ('68', 'Weak', 'Does not perform well in physical challenges. Not useful physically around camp.', '', '', '2016-09-24 15:39:12', ''), ('69', 'Aggressive', 'Shows cut throat behaviour, is antagonizing, plays hard, intimidates others, is bossy and argumentative', '', '', '2016-09-24 15:39:12', 'Russel tells Sandra \"You\'re either with me or against me\"'), ('70', 'Temper', 'Shows flare ups of anger, shouts at others, irritated, is insulting and abusive to others', '', '', '2016-09-24 15:39:12', 'Sandra, \"I can get loud too, what the F!!\"; J\'Tia dumps out the rice'), ('71', 'Egotisical', 'Brags, thinks a lot of themselves and their opinions, thinks people should agree with them and do what they say', '', '', '2016-09-24 15:39:12', 'Drew Christie says he\'s \"basically a badass\"'), ('72', 'Emotional', 'Shows episodes of crying, feeling sorry for themselves, extreme homesickness, feeling picked on feeling left out, insecure and anxious', '', '', '2016-09-24 15:39:12', 'Aubry having a mango breakdown, \"I wish you guys could know the real me!\"'), ('73', 'Minion', 'Shows little independent thought and does what they are told or simply what everyone else is doing, are simply a \"number\" for their alliance', '', '', '2016-09-24 15:39:12', 'Rancher Rick.'), ('74', 'Lazy', 'Shows unwillingness to work around camp or try hard in challenges', '', '', '2016-09-24 15:39:12', ''), ('75', 'Naive', 'Shows tendency to be foolish, is manipulated by other players, believes people who are lying to them, makes silly game decisions', '', '', '2016-09-24 15:39:12', 'Trozan believing Kim was with the men.');
COMMIT;

