INSERT INTO `character_types` VALUES ('3', '1', 'Good Ol\' Boy', 'M', 'Southern accent, country roots, often a farmer/rancher, social, loyal, easy to get along with.', '2017-10-31 14:38:38'), ('4', '2', 'Know-It-All', 'M', 'Superfan, highly intelligent, understands strategy, often well educated, funny, can be arrogant.', '2017-10-31 14:38:53'), ('5', '3', 'Seduce and Destroy', 'M', 'Young professional (marketing/sales), \"ladies man\", super arrogant, thinks he\'s very charming.', '2017-10-31 14:57:48'), ('6', '4', 'Social Butterfly (Perez Hilton)', 'M', 'Sometimes gay, super social, witty, extremely likeable.', '2017-10-31 14:39:35'), ('7', '5', 'Alpha Male Control Freak', 'M', 'CEO or doctor, rich and powerful, bossy, controlling.', '2017-10-31 14:39:53'), ('8', '6', 'The Specialist', 'M', 'Eccentric, little crazy, full of himself, huge character with huge stories, a legend in his own mind.', '2017-10-31 14:40:37'), ('9', '7', 'True Grit', 'M', 'Retired pro athlete or military guy, cop, firefighter. Bloody minded, single purpose, tough, not social.', '2017-10-31 14:40:25'), ('10', '8', 'John McClane', 'M', '25-35 regular Joe (blue collar job), aggressive,  intense, funny, social, athletic.', '2017-10-31 14:40:13'), ('11', '9', 'Surfer Dude', 'M', 'Long hair, easy going, very athletic, new agey, social, flakey job, calls you bro.', '2017-10-31 14:40:55'), ('12', '10', 'Mr. Miyagi', 'M', 'Kind, wise, intelligent, well spoken, not intense, highly reflective, easy going.', '2017-10-31 14:41:08'), ('13', '11', 'Heisenberg', 'M', 'Intense middle aged man. Usually blue collar job. Very aggressive and high energy. Can be strong but not athletic. Critical and cut throat. Willing to do anything.', '2017-10-31 14:41:19'), ('14', '12', 'Ponyboy', 'M', '(Age: 25-35) The weirdo, strange job, seems the odd person out, nice, not strategic, likeable.', '2017-10-31 14:41:34'), ('15', '13', 'Tough Old Broad', 'F', '(Age: 40+) wiry, very athletic, loyal, sometimes too nice, emotional.', '2017-10-31 14:41:46'), ('16', '14', 'Mommy Dearest', 'F', '(Age: 35+) Mom, may or may not be athletic, either very maternal or very cutting.', '2017-10-31 14:42:20'), ('17', '15', 'Oh No You Didn\'t!', 'F', 'Loud, bossy, big opinions, outgoing, explosive, social, strong.', '2017-10-31 14:42:29'), ('18', '16', 'Siren', 'F', 'Very social, charming, pretty, talks about how she flirts all the time.', '2017-10-31 14:42:40'), ('19', '17', 'Little Red Riding Hood', 'F', 'Very young, gorgeous, pageant girl, can be tough but not particularly smart.', '2017-10-31 14:42:54'), ('20', '18', 'I Can See Your Periscope', 'F', '(Age: 40+) Lawyer/cop/firefighter, very good at reading people, bossy, intelligent.', '2017-10-31 14:43:27'), ('21', '19', 'Secretly Smart Bikini Babe', 'F', '(Age: 20-25) Often law/med student, very pretty, very intelligent.', '2017-10-31 14:43:16'), ('22', '20', 'Meredith Grey', 'F', '(Age: 25-35) Doctor, lawyer, cop, teacher. Smart, intense, high energy.', '2017-10-31 14:43:42'), ('23', '21', 'Erin Brockovich', 'F', '(Age: 30-45) Regular-ish job, very social, athletic, smart, competitive.', '2017-10-31 14:43:53'), ('24', '22', 'G.I. Jane', 'F', 'Extremely tough and athletic, likes to hunt/fish, sometimes a pro athlete.', '2017-10-31 14:44:10'), ('25', '23', 'Lady Gaga', 'F', 'Flakey, new agey, not mainstream, not strategic, spacey.', '2017-10-31 14:44:27'), ('26', '24', 'Chelsea Handler', 'F', 'Any profession. Very witty, critical, doesn\'t have to be gorgeous, highly intelligent, very social.', '2017-10-31 14:58:26'), ('27', '25', 'Culturally Awkward  Girl', 'F', 'Outsider, nice, not strategic, shy, often Asian, sometimes weird job.', '2017-10-31 14:44:53'), ('28', '26', 'Crazy Cat Lady', 'F', 'Older, unstable, emotional, loud, off-putting, rough around the edges.', '2017-10-31 14:45:05');
COMMIT;

