  KEY `individual_wins` (`individual_wins`),
  KEY `created_date` (`created_date`),
  KEY `character_type_id` (`character_type_id`)
) ENGINE=MyISAM AUTO_INCREMENT=1065 DEFAULT CHARSET=latin1;

